import React from "react";

import { Container, Header } from "./styles";

const Dashboard = () => {
  return (
    <>
      <Header>
        <div className="iconArea"></div>
        <div></div>
      </Header>
      <Container>
        <div></div>
      </Container>
    </>
  );
};

export default Dashboard;
